//============Session Management============

function randomInt() {
	var x = Math.ceil(Math.random()*125) + 33;
	return x;
}
function createSessionID() {
	var sessionID = "";
	for(i=0;i<16;i++) {
		sessionID += randomInt().toString(16);
	}
	return sessionID;
}
exports.createSessionID = createSessionID();